import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  state = {
    randomNumber: null,
  };

  componentDidMount() {
    fetch('http://localhost:4000').then(res => {
      this.setState({
        randomNumber: res.randomNumber
      });
    });
  }

  render() {
    return (
      <div className="App">
        {this.state.randomNumber}
      </div>
    );
  }
}

export default App;
